import React, {useState} from 'react'

export default function Search() {
    const [Search, setSearch] = useState('');

    const onSearches = event => {setSearch(event.target.value)}



    return (
        <div>
            <input type="text" placeholder="Search here!" onChange={onSearches}></input>        
        </div>
    )
}

export const filtered = test => {test.filter(results => {return(results.name.includes(Search))});}
